var title_f39_12_40134="Dirofilaria immitis life cycle";
var content_f39_12_40134=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F79410&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F79410&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 584px\">",
"   <div class=\"ttl\">",
"    Dirofilaria immitis life cycle",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 564px; height: 477px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    During a blood meal, an infected mosquito (",
"    <em>",
"     Aedes",
"    </em>",
"    ,",
"    <em>",
"     Culex",
"    </em>",
"    ,",
"    <em>",
"     Anopheles",
"    </em>",
"    ,",
"    <em>",
"     Mansonia",
"    </em>",
"    ) introduces third-stage filarial larvae of",
"    <em>",
"     Dirofilaria immitis",
"    </em>",
"    into the skin of the definitive host, which is usually a domestic dog or coyote in the United States (although a wide variety of other animals can also be infected, including felids, mustelids, pinnipeds, beaver, horses, and humans), where they penetrate into the bite wound",
"    <strong>",
"     (1)",
"    </strong>",
"    . In the definitive host, the L3 larvae undergo two more molts into L4 and adults. Adults reside in pulmonary arteries, and are occasionally found in the right ventricle of the heart",
"    <strong>",
"     (2)",
"    </strong>",
"    . Adult females are usually 230 to 310 mm long by 350 &micro;m wide; males are usually 120 to 190 mm long by 300 &micro;m wide. Adults can live for 5 to 10 years. In the heart, the female worms are capable of producing microfilariae over their lifespan. The microfilariae are found in peripheral blood",
"    <strong>",
"     (3)",
"    </strong>",
"    . A mosquito ingests the microfilariae during a blood meal",
"    <strong>",
"     (4)",
"    </strong>",
"    . After ingestion, the microfilariae migrate from the mosquito's midgut through the hemocoel to the Malpighian tubules in the abdomen",
"    <strong>",
"     (5)",
"    </strong>",
"    . There the microfilariae develop into first-stage larvae",
"    <strong>",
"     (6)",
"    </strong>",
"    and subsequently into third-stage infective larvae",
"    <strong>",
"     (7)",
"    </strong>",
"    . The third-stage infective larvae migrate to the mosquito's proboscis",
"    <strong>",
"     (8)",
"    </strong>",
"    and can infect another definitive host when it takes a blood meal",
"    <strong>",
"     (1)",
"    </strong>",
"    . In humans",
"    <strong>",
"     (9)",
"    </strong>",
"    ,",
"    <em>",
"     D. immitis",
"    </em>",
"    larvae tend to follow the same migratory pathway as in the canine host, ending up in the lungs, where they often lodge in small-caliber vessels, causing infarcts and typical \"coin lesions\" visible on radiographs.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Centers for Disease Control and Prevention. Parasites and Health: Filariasis. Available at:",
"     <a href=\"file://www.dpd.cdc.gov/dpdx/html/imagelibrary/A-F/Filariasis/body_Filariasis_il22.htm\" target=\"_blank\">",
"      file://www.dpd.cdc.gov/dpdx/html/imagelibrary/A-F/Filariasis/body_Filariasis_il22.htm",
"     </a>",
"     .",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
