var title_f39_12_40139="Parenteral antibiotics for infections due to MRSA";
var content_f39_12_40139=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F57196&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F57196&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Parenteral antimicrobial therapy for infections due to methicillin-resistant Staphylococcus aureus (MRSA) in adults",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Drug",
"       </td>",
"       <td class=\"subtitle1\">",
"        Adult dose",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vancomycin",
"       </td>",
"       <td>",
"        30 mg/kg IV every 24 hours in 2 equally divided doses; not to exceed 2 g/24 hours unless concentrations in serum are inappropriately low",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\" colspan=\"2\">",
"        Daptomycin",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Skin and soft tissue infection",
"       </td>",
"       <td class=\"sublist_other\">",
"        4 mg/kg IV once daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Bacteremia",
"       </td>",
"       <td class=\"sublist_other\">",
"        6 mg/kg IV once daily*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Linezolid",
"       </td>",
"       <td>",
"        600 mg IV (or orally) twice daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ceftaroline",
"       </td>",
"       <td>",
"        600 mg IV every 12 hours",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tigecycline",
"       </td>",
"       <td>",
"        100 mg IV once, thereafter 50 mg IV every 12 hours",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     IV: intravenously.",
"     <br>",
"      * Because daptomycin exhibits concentration-dependent killing, some experts recommend doses of up to 8 to 10 mg/kg IV once daily, which appear safe, though additional studies are needed",
"      <sup>",
"       [1,2]",
"      </sup>",
"      .",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br>",
"      <ol>",
"       <li>",
"        Figueroa DA, Mangini E, Amodio-Groton M, et al. Safety of high-dose intravenous daptomycin treatment: three-year cumulative experience in a clinical program. Clin Infect Dis 2009; 49:177-80.",
"       </li>",
"       <li>",
"        Benvenuto M, Benziger DP, Yankelev S, Vigliani G. Pharmacokinetics and tolerability of daptomycin at doses up to 12 milligrams per kilogram of body weight once daily in healthy volunteers. Antimicrob Ther Chemother 2006; 50:3245-9.",
"       </li>",
"      </ol>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
