var title_f39_12_40140="Causes of pediatric acute airway obstruction";
var content_f39_12_40140=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F51465&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F51465&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Differential diagnosis of acute upper airway obstruction in children",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Condition",
"      </td>",
"      <td class=\"subtitle1\">",
"       Characteristic features",
"      </td>",
"      <td class=\"subtitle1\">",
"       Radiographic features",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Epiglottitis (supraglottitis)",
"      </td>",
"      <td>",
"       Fever, toxic appearance; anxiety out of proportion to degree of respiratory distress; \"tripod\" and/or \"sniffing\" posture; drooling",
"      </td>",
"      <td>",
"       Swollen epiglottis (\"thumb sign\") on lateral neck radiograph",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Laryngotracheitis (croup)",
"      </td>",
"      <td>",
"       Typically occurs in children 6 to 36 months; \"barking\" cough, stridor; \"steeple sign\" on anteroposterior neck radiograph",
"      </td>",
"      <td>",
"       <p>",
"        Tapering of upper airway (\"steeple sign\") on anteroposterior neck radiograph",
"       </p>",
"       <p>",
"        Subglottic narrowing and distended hypopharynx on lateral neck radiograph",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Bacterial tracheitis",
"      </td>",
"      <td>",
"       Fever, toxic appearance",
"      </td>",
"      <td>",
"       Intraluminal membranes and tracheal wall irregularity",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Uvulitis",
"      </td>",
"      <td>",
"       Swelling and erythema of the uvula",
"      </td>",
"      <td>",
"       Radiographs usually not necessary",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Foreign body",
"      </td>",
"      <td>",
"       History of sudden onset of choking (though this history is frequently absent); hoarseness or stridor with laryngeal or upper esophageal foreign body",
"      </td>",
"      <td>",
"       Visualization of radio-opaque foreign body; upper esophageal foreign body may cause distortion or deviation of extrathoracic trachea",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Retropharyngeal abscess",
"      </td>",
"      <td>",
"       Typically occurs in children aged two to four years; neck pain, fever, pain with swallowing; drooling; unwillingness to move the neck; trismus; midline or unilateral swelling of posterior pharyngeal wall",
"      </td>",
"      <td>",
"       Widening of the retropharyngeal space and reversal of the normal cervical spine curvature",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Peritonsillar abscess",
"      </td>",
"      <td>",
"       Typically occurs in older children and adolescents; drooling; trismus; muffled voice; tonsillar swelling with deviation of the uvula",
"      </td>",
"      <td>",
"       Radiographs usually not necessary for diagnosis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Angioedema",
"      </td>",
"      <td>",
"       Rapid onset without prodromal viral illness; swelling of lips and tongue; urticarial rash; dysphagia without hoarseness; possible history of previous attack",
"      </td>",
"      <td>",
"       Radiographs usually not necessary for diagnosis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Congenital anomalies (eg, laryngeal web, laryngomalacia)",
"      </td>",
"      <td>",
"       Generally have a chronic course and lack systemic symptoms (unless airway narrowing is exacerbated by concomitant infection)",
"      </td>",
"      <td>",
"       Radiographs usually not necessary for diagnosis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Respiratory diphtheria",
"      </td>",
"      <td>",
"       Gradual onset of symptoms: sore throat, malaise, and low-grade fever; presence of diphtheritic membrane",
"      </td>",
"      <td>",
"       Radiographs usually not necessary for diagnosis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Thermal or chemical injury",
"      </td>",
"      <td>",
"       History of exposure; lack of fever or prodromal illness",
"      </td>",
"      <td>",
"       Radiographs usually not necessary for diagnosis",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
